import React, { useEffect, useState } from "react";
import axios from "axios";
import "../styles/AdminDashboard.css";

const API_URL = "http://localhost:1212/api";

const AdminDashboard = () => {
  const [flights, setFlights] = useState([]);
  const [airports, setAirports] = useState([]);
  const [airplanes, setAirplanes] = useState([]);
  const [users, setUsers] = useState([]);
  const [bookings, setBookings] = useState([]);

  const token = localStorage.getItem("token");

  const headers = {
    Authorization: `Bearer ${token}`,
  };

  // --- Fetch All Entities ---
  const fetchAllData = async () => {
    try {
      const [flightsRes, airportsRes, airplanesRes, usersRes, bookingsRes] = await Promise.all([
        axios.get(`${API_URL}/flights`, { headers }),
        axios.get(`${API_URL}/airports`, { headers }),
        axios.get(`${API_URL}/airplanes`, { headers }),
        axios.get(`${API_URL}/users`, { headers }),
        axios.get(`${API_URL}/bookings`, { headers }),
      ]);
      setFlights(flightsRes.data);
      setAirports(airportsRes.data);
      setAirplanes(airplanesRes.data);
      setUsers(usersRes.data);
      setBookings(bookingsRes.data);
    } catch (error) {
      console.error("Failed to fetch admin data:", error);
    }
  };

  useEffect(() => {
    fetchAllData();
  }, []);

  return (
    <div className="admin-dashboard">
      <h1>Admin Dashboard</h1>

      {/* Flights Section */}
      <section>
        <h2>Flights ✈️</h2>
        <ul>
          {flights.map(f => (
            <li key={f.flightId}>
              {f.flightNumber}: {f.source} → {f.destination} on {f.departureDate}
            </li>
          ))}
        </ul>
      </section>

      {/* Airports Section */}
      <section>
        <h2>Airports 🛫</h2>
        <ul>
          {airports.map(a => (
            <li key={a.airportId}>{a.name} - {a.city}</li>
          ))}
        </ul>
      </section>

      {/* Airplanes Section */}
      <section>
        <h2>Airplanes 🛬</h2>
        <ul>
          {airplanes.map(p => (
            <li key={p.airplaneId}>{p.model} ({p.capacity} seats)</li>
          ))}
        </ul>
      </section>

      {/* Users Section */}
      <section>
        <h2>Users 👤</h2>
        <ul>
          {users.map(u => (
            <li key={u.userId}>{u.userName} — {u.userEmail}</li>
          ))}
        </ul>
      </section>

      {/* Bookings Section */}
      <section>
        <h2>Bookings 📄</h2>
        <ul>
          {bookings.map(b => (
            <li key={b.bookingId}>
              Booking #{b.bookingId} — Flight {b.flight?.flightNumber} by {b.user?.userName}
            </li>
          ))}
        </ul>
      </section>
    </div>
  );
};

export default AdminDashboard;
